import React from 'react';
import './AboutMe.css';
import { makeStyles } from '@material-ui/core/styles';

import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';


const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    paddingBottom: 100
  },
  gridList: {
    width: 750,
    height: 1000,
    paddingTop: 100,
    paddingLeft: 100,
  },
  text:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    minHeight: 1000,
  },
  title:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    position: "absolute",
    zIndex: 1
  },
  img:{
    height: 1000,
    maxWidth: 200
  }
}));
export default function AboutMe(props) {
  const classes = useStyles(); 
    return(
      <div className={classes.img}>
        <div className = "Profile-image">
          <img src={"https://noahsaldanadesign.com/img/IMG_3958.jpg"} alt={"https://noahsaldanadesign.com/img/IMG_3958.jpg"}/>
        </div>
      </div>
    )
}
